import { ImSad  } from "react-icons/im";
import "./Feedback.js.css"
export default  function feedback(props) {
    return (
        <div>
            <h2>FeedBacks</h2>
            {props.feedback.length === 0 ?
                <p><ImSad /> No Feedbacks</p> :
            <ul className='Card'>
                {props.feedback.map((feed, index) => <li key={index}>{feed}</li>)}
            </ul>
            }
        </div>
    )
}
